    hli = s.rfind('#')
    fail = False
    sc1 = 0
    for i in range(hli):
        if s[i] == '(':
            sc1 += 1
        else:
            sc1 -= 1
        if sc1 < 0:
            fail = True
            break
    sc2 = 0
    if not fail:
        for i in range(len(s) - 1, hli, -1):
            if s[i] == ')':
                sc2 += 1
            else:
                sc2 -= 1
            if sc2 < 0:
                fail = True
                break
    if fail or sc1 - sc2 < 1:
        return -1
    replacements = [1] * (s.count('#') - 1)
    replacements.append(sc1 - sc2)
    return replacements

